import type { FC } from "react";

import {
  CheckboxComponent,
  Input,
  NumberInputComponent,
  SelectComponent,
  SwitchComponent,
} from "components";
import styles from "./TodoInsert.module.scss";
import { EducationalData } from "../../components/SelectComponent/utils";
import { useContext } from "react";
import { MyContextData } from "../index";

const TodoInsert: FC = () => {
  const { setData, data } = useContext<any>(MyContextData);
  return (
    <div className={styles.wrapper}>
      <p className={styles.wrapper__title}>Insert Row</p>
      <Input placeholder="Name" />
      <NumberInputComponent />
      <SelectComponent items={EducationalData} placeholder="select place" />
      <CheckboxComponent label="Employed" />
      <button className={styles.wrapper__button}>Insert</button>
      <hr />
      <SwitchComponent text="Mode" />
      <button className={styles.wrapper__button}>Delete</button>
    </div>
  );
};
export default TodoInsert;
